import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.todoItems = [
        'Job 1',
        'Job 2',
        'Job 3'
    ];
  }

  render() {
    return (
      <div className="App"> 
        {
          this.todoItems.map((item) => <TodoList />)
        }
      </div>
    );
  }

}

export default App;
